import React from 'react';
import './index.css';

class MealMap extends React.Component{

  componentDidMount(){
    let map= new window.google.maps.Map(document.getElementById('root'),{
      center:{lat:-33.8688,lng:151.2195},
      zoom:13,
      mapTypeId:'roadmap',
    });
  }
  render(){
    return (
      <div id='app'>
        <div is='map' />
      </div>
    );
  }


}
export default MealMap;
